import React, {useState, useEffect} from 'react';
import ReactDOM from 'react-dom';

const StudentList = (props) => {
    const [list, setList] = useState();

    useEffect(() => {
        debugger;
        fetch('https://6079395e460a6600174fb472.mockapi.io/api/v1/Students/'+props.rowId)
        .then(res => res.json())
        .then((data) => {
            setList( data )
            debugger;
        })
        .catch(console.log) 
      });
    return (
        <div>
            <p>Student Data{props.rowId}</p>

            <table className="wrapped confluenceTable tablesorter tablesorter-default">
                <thead>
                    <tr className="tablesorter-headerRow">
                        <th>
                            Student Name
                        </th>
                        <th>
                            Age
                        </th>
                        <th>
                            GPA
                        </th>
                        <th>

                        </th>
                        <th>

                        </th>

                    </tr>
                </thead>
                <tbody>
                    {
                        list.map(el => (
                            <tr key={el.stuId}>
                              
                              <td>
                                    {el.stuFName} {el.stuLName}

                                </td>
                                <td>
                                     {el.stuAge} 
                                </td>
                                <td>
                                     {el.stuGpa} 
                                </td>
                                <td>
                                    edit
                                </td>
                                <td>
                                    delete
                                </td>
                            </tr>
                        ))
                    }
                </tbody>
            </table>     



        </div>
    );

}

export default StudentList;
